protected void subscribeActual(CompletableObserver observer) {
    Disposable d = Disposables.empty();
    observer.onSubscribe(d);
    try {
        runnable.run();
    } catch (Throwable e) {
        Exceptions.throwIfFatal(e);
        if (!d.isDisposed()) {
            observer.onError(e);
        } else {
            RxJavaPlugins.onError(e);
        }
        return;
    }
    if (!d.isDisposed()) {
        observer.onComplete();
    }
}

